import React from "react";
import "../styles/Home.css";


const Home = () => {
  return (
    <div className="home-container">
      <h1 className="title">Attendance System</h1>
      <p className="subtitle">Select your branch to continue</p>

      <div className="branch-cards">
        <div className="card glass bca">BCA</div>
        <div className="card glass bcom">BCOM</div>
        <div className="card glass ba">BA</div>
      </div>
    </div>
  );
};

export default Home;
